(198, 16, 'Cletter_Read', 'เปิดอ่าน ศย 004/ว909 ลว 24 ก.ย.62  กศ. ประชาสัมพันธ์ข้อมูลข่าวสารด้านการบริหารทรัพยากรบุคคล', '10.37.64.42', '2019-09-25 15:29:22'),
(199, 16, 'Cletter_Read', 'เปิดอ่าน ด้วยคณะกรรมการบริหารศาลยุติธรรมได้ออกระเบียบคณะกรรมการบริหาร ศาลยุติธรรม ว่าด้วยการให้บริการแก่ประชาชนผู้มาติดต่อราชการศาลยุติธรรม (ฉบับที่ ๓) พ.ศ. ๒๕๖๒ โดยมีผลใช้บังคับตั้งแต่วันประกาศเป็นต้นไป(ประกาศ ณ วันที่ ๒๐ กันยายน ๒๕๒๖)', '10.37.64.42', '2019-09-25 15:31:37'),
(200, 16, 'Cletter_Read', 'เปิดอ่าน ตารางเวร เดือน ตุลาคม 2562 + ตรวจ', '10.37.64.42', '2019-09-25 15:34:28'),
(201, 16, 'Cletter_Read', 'เปิดอ่าน ขอเชิญรับชมการอภิปรายโครงกาสัมนาทางวิชาการ หัวข้อ \"กฎหมายเกี่ยวกับคดีอาญาของ ผู้ดำรงตำแหน่งทางการเมือง: ประสบการณ์จาก Aix-Marseille Universite สาธารณรัฐ ฝรั่งเศส\" ผ่านระบบ Streaming 23 ก.ย.62 เวลา 12.30 - 14.00 น.', '10.37.64.42', '2019-09-25 15:37:31'),
(202, 16, 'Cletter_Read', 'เปิดอ่าน ขอเชิญรับชมการอภิปรายความรู้ตามโครงการเผยแพร่ความรู้ทางด้านกฎหมายและการพิจารณา พิพากษาคดีของข้าราชการฝ่ายตุลาการศาลยุติธรรม เรื่อง หลักเกณฑ์การปล่อยชั่วคราวโดยใช้ EM ตามข้อบังคับของประธานศาลฎีกาฯ ฉบับไหม่', '10.37.64.42', '2019-09-25 15:37:38'),
(203, 16, 'Cletter_Read', 'เปิดอ่าน ศย 007/ว 863 ลว 4 ก.ย.62 ด้วยคณะกรรมการคัดเลือกข้าราชการฝ่ายตุลาการศาลยุติธรรมเพื่อเสนอชื่อขอรับทุน รัฐบาลญี่ปุ่นโครงการ Young Leaders\' Progam (MLP) ประจำปี ๒๕๖๓ โดยกำหนดเปิดรับสมัคร ระหว่างวันพุธที่ ๔ กันยายน ๒๕๖๒ ถึงวันพุธที่ ๒ ตุลาคม ๒๕๖๒', '10.37.64.42', '2019-09-25 15:38:05'),
(204, 16, 'Cletter_Read', 'เปิดอ่าน ศย 025/ส 862 ลว.4 ก.ย.62 สำนักส่งเสริมงานตุลาการแนะนำแนวทางปฏิบัติและการใช้งานระบบรายงานและการติดตามผลการส่งหมายข้ามเขต ในวันศุกร์ที่ 6 ก.ย.62 เวลา 13.30-16.00 น.', '10.37.64.42', '2019-09-25 15:38:36');
