(8, 'นายธรัชต์ จีระตระกูล', 'ผู้พิพากษาหัวหน้าศาลเยาวชนและครอบครัวจังหวัดชุมพร', 'ช่วยทํางานชั่วคราวในตําแหน่งผู้พิพากษาหัวหน้า', 'ศาลเยาวชนและครอบครัวจังหวัดประจวบคีรีขันธ์', 0, '2020-03-31 15:13:01'),
