(11, 'นางสาววนิดา พิพัฒน์นภาพร', 'ผู้อำนวยการสำนักงานประจำศาลเยาวชนและครอบครัว', 'จังหวัดประจวบคีรีขันธ์', '', 1, '2022-04-10 02:55:11'),
